function setStyle(a){
    let objectType = ggbApplet.getObjectType(a);
    if (['ray', 'line', 'function', 'hyperbola', 'parabola', 'inequality'].includes(objectType)) {
        ggbApplet.setLayer(a, 3);
    }
}


